    private void btnSiguiente1ActionPerformed(java.awt.event.ActionEvent evt) {//GEN-FIRST:event_btnSiguiente1ActionPerformed
        // TODO add your handling code here:

        if (FormularioSercotec.txtRut.getText().trim().isEmpty() || FormularioSercotec.txtRut.getText().length() > 9 || FormularioSercotec.txtRut.getText().length() < 8) {

            JOptionPane.showMessageDialog(null, "Debe completar el campo RUT \n Debe ingresar un RUT valido", "ERROR", JOptionPane.WARNING_MESSAGE);

        } else if (FormularioSercotec.txtNombres.getText().trim().isEmpty()) {

            JOptionPane.showMessageDialog(null, "Debe completar el campo NOMBRES", "ERROR", JOptionPane.WARNING_MESSAGE);

        } else if (FormularioSercotec.txtApellidoPat.getText().trim().isEmpty()) {

            JOptionPane.showMessageDialog(null, "Debe completar el campo APELLIDO PATERNO", "ERROR", JOptionPane.WARNING_MESSAGE);

        } else if (FormularioSercotec.txtApellidoMat.getText().trim().isEmpty()) {

            JOptionPane.showMessageDialog(null, "Debe completar el campo APELLIDO MATERNO", "ERROR", JOptionPane.WARNING_MESSAGE);

        } else if (FormularioSercotec.txtConcurso.getText().trim().isEmpty()) {

            JOptionPane.showMessageDialog(null, "Debe completar el campo CONCURSO", "ERROR", JOptionPane.WARNING_MESSAGE);

        } else if (FormularioSercotec.txtCelular.getText().trim().isEmpty() || FormularioSercotec.txtCelular.getText().length() > 9 || FormularioSercotec.txtCelular.getText().length() < 9) {

            JOptionPane.showMessageDialog(null, "Debe completar el campo CELULAR \n Debe ingresar un CELULAR valido", "ERROR", JOptionPane.WARNING_MESSAGE);

        } else if (FormularioSercotec.txtEmail.getText().trim().isEmpty()) {

            JOptionPane.showMessageDialog(null, "Debe completar el campo EMAIL", "ERROR", JOptionPane.WARNING_MESSAGE);

        } else if (FormularioSercotec.txtDireccionPersona.getText().trim().isEmpty()) {

            JOptionPane.showMessageDialog(null, "Debe completar el campo DIRECCION", "ERROR", JOptionPane.WARNING_MESSAGE);

        } else if (FormularioSercotec.cboLocalidad.getSelectedItem().toString() == "-Seleccione-") {

            JOptionPane.showMessageDialog(null, "Debe seleccionar una LOCALIDAD valida", "ERROR", JOptionPane.WARNING_MESSAGE);

        } else if (FormularioSercotec.cboProvincia.getSelectedItem().toString() == "-Seleccione-") {

            JOptionPane.showMessageDialog(null, "Debe seleccionar una PROVINCIA valida", "ERROR", JOptionPane.WARNING_MESSAGE);

        } else if (FormularioSercotec.ftfFechaEntregaProyectoEstimada.getText().trim().isEmpty()) {

            JOptionPane.showMessageDialog(null, "Debe completar el campo FECHA ENTREAGA PROYECTO ESTIMADA", "ERROR", JOptionPane.WARNING_MESSAGE);

        } else if (FormularioSercotec.txtPersonaContactoProyecto.getText().trim().isEmpty()) {

            JOptionPane.showMessageDialog(null, "Debe completar el campo PERSONA CONTACTO PROYECTO", "ERROR", JOptionPane.WARNING_MESSAGE);

        } else if (FormularioSercotec.txaDescripcionProyecto.getText().trim().isEmpty()) {

            JOptionPane.showMessageDialog(null, "Debe completar el campo DESCRIPCION PROYECTO", "ERROR", JOptionPane.WARNING_MESSAGE);

        } else {

            FormularioSercotecDos abrir = new FormularioSercotecDos();
            abrir.setVisible(true);

            FormularioSercotecDos.cboLocalidadParticular.setSelectedItem(FormularioSercotec.cboLocalidad.getSelectedItem());

            FormularioSercotecDos.txtCelular.setText(FormularioSercotec.txtCelular.getText());

            FormularioSercotecDos.txtNombreDos.setText(FormularioSercotec.txtNombres.getText());
            FormularioSercotecDos.txtApellidoPatDos.setText(FormularioSercotec.txtApellidoPat.getText());
            FormularioSercotecDos.txtApellidoMatDos.setText(FormularioSercotec.txtApellidoMat.getText());

            FormularioSercotecDos.txtDireccionParticular.setText(FormularioSercotec.txtDireccionPersona.getText());

            FormularioSercotecDos.txtEmail2.setText(FormularioSercotec.txtEmail.getText());

        }


    }//GEN-LAST:event_btnSiguiente1ActionPerformed

    private void txtRutKeyTyped(java.awt.event.KeyEvent evt) {//GEN-FIRST:event_txtRutKeyTyped
        // TODO add your handling code here:
        char validar = evt.getKeyChar();

        if (Character.isLetter(validar)) {

            getToolkit().beep();
            evt.consume();

            JOptionPane.showMessageDialog(null, "Ingresar solo numeros");

        }
    }//GEN-LAST:event_txtRutKeyTyped

